import { RiTodoLine } from 'react-icons/ri'

import styles from './Todo.module.css'

function Todo({ todo, index, deleteTodo }) {
  return (
    <div
      className={styles.todo}
      onDoubleClick={() => {
        deleteTodo(index)
      }}
    >
        <RiTodoLine/>
      <div className={styles.todoText}>{todo}</div>
    </div>
  )
}

export default Todo
